import styled from "styled-components";

export const StyledContent = styled.div`

  
  margin: 10px;
  border: 1px solid #A5A4A7;
  border-radius: 3px;
  background-color: #D3D2D6;

  input  {
  box-sizing: border-box;
  width: 40% ;

  .contentFeatures {
    display: flex;
    flex-direction: row;
    box-sizing: border-box;
  }
  .a {
    display: flex;
    width: 40%;
  }
} 

`;
